  console.log(eduDetails[0]);
  if (eduDetails[0] === undefined) {
    console.log("undefined");
  } else {
    return (
      <div className="EduDetailsRender">
        {eduDetails[0].map(function (e) {
          console.log(e);
        })}
      </div>
    );
  }
  return {};
}

export default EducationalQualifications;
